methods.description:
GET 请求

例子：
```javascript
1. 直接传递一个Request 实例
 const req = new Request('/test?foo=1&bar=2', {method: 'GET'});
 this.query(req, console.log );

2. 直接传递一个url
 this.query('/test', console.log);

3. 直接传递一个包含url、data内容的对象
 this.query({
      url: '/test',
      data: { foo:1, bar:2 },
      handleAs: 'json'
  }, console.log, console.log );
```
******************************************************

POST 请求

```javascript
1. 直接传递一个Request 实例
 const req = new Request('/test?foo=1&bar=2', {method: 'POST'});
 this.post(req, console.log );

2. 直接传递一个url
 this.post('/test', console.log);

3. 直接传递一个包含url、data内容的对象
 this.post({
      url: '/test',
      data: { foo:1, bar:2 }
  }, console.log, console.log );

 4. 上传文件
 const formData = new FormData();
 formData.append('file1', new File([], 'filename'));
 this.post({
     url: '/upload',
     data: formData
 }, console.log, console.log );

 5. 发送json格式的数据
 this.post({
     url: '/upload',
     data: {foo:1,bar:2},
     sendAsJson: true
 }, console.log, console.log );
```
